    false,nt"url": null,nt"notes": "This annual narrative report details the
    conditions and management of San Francisco Bay National Wildlife Refuge in 1974.
     The report begins with a general description of the refugeu2019s location, history,
    and management units.  Wildlife is discussed next; special detail is given to migratory
    birds, fur animals, mammals, and raptors.  Refuge development and maintenance projects
    are outlined in the next section which includes: boundary posting, litter removal,
    and Environmental Impact Assessment preparation.  Finally, field investigations
    and public relations are discussed.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
